@AlMosahf عنْ أبي بَكْرٍ الصِّدِّيق رضي اللَّه عنه قال: نظرتُ إلى أقْدَامِ المُشْرِكِينَ ونَحنُ في الْغَارِ وهُمْ علَى رؤوسنا فقلتُ: يا رسولَ اللَّهِ
لَوْ أَنَّ أحَدَهمْ نَظرَ تَحتَ قَدميْهِ لأبصرَنا فقال: «مَا ظَنُّك يا أبا بكرٍ باثْنْينِ اللَّهُ ثالثُِهْما» 
متفقٌ عليه
